import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min";
import {Maps} from './components/Maps';




function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <div className="container">
      <Maps/>
      </div>
      </BrowserRouter>

  </div>
  );
}

export default App;
